import React from 'react';
import logo from './logo.svg';
import './App.css';
import Appbar from './Appbar.js';
import ListBook from './components/ListBook';
function App() {
  return (
    <div className="App">
     <Appbar />
     <route path='\' component='AddBook'></route>
    </div>
  );
}

export default App;
